import React from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';

import pageConfig from '../../utils/pageConfig';
import PageHeader from '../../components/PageHeader/PageHeader';
import DataCards from '../../components/DataCards/DataCards';

const ListPage = props => {
  const { pageTitle, actions } = pageConfig[props.page];

  return (
    <div className="list-page">
      <PageHeader title={pageTitle} actions={actions} />
      <DataCards data={[]} />
      <div>Hello world</div>
    </div>
  );
};

ListPage.propTypes = {
  page: PropTypes.string.isRequired,
  action: PropTypes.string.isRequired,
  cardData: PropTypes.array.isRequired
};

ListPage.defaultProps = {};

const mapStateToProps = state => ({
  cardData: state.cardData
});

const mapDispatchToProps = (dispatch, props) =>{
  const type = pageConfig[props.page][props.action];
  // return {
  //   {
  //     dispatch({type})
  //   }
  // };
}

export default withRouter(connect(mapStateToProps, mapDispatchToProps)(ListPage));
